import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <nav className="navbar navbar-expand-lg navbar-light bg-light">
            <div className="container-fluid">
                <div className="navbar-header">
                    <button type="button" className="navbar-toggler navbar-toggler-sidebar collapse">
                        MENU
                    </button>
                    <button type="button" className="navbar-toggler collapse" data-to>

                    </button>
                </div>
            </div>
        </nav>
      </div>
    );
  }
}

export default App;
